import React from "react";
import { useContext } from "react";
import { UserContext } from "../userContext";
import '../components/styles.css'

function SolvedScreen(props){
  const {difficultyLevel} = useContext(UserContext)
  const isSolved = props.isSolved;

const level = () => {
  let levelName = "hmmmmm";
  if(props.difficultyLevel === 1){
    levelName = "Easy"
  } else if(props.difficultyLevel === 2){
    levelName = "Medium";
  } else if(props.difficultyLevel === 3){
    levelName = "Hard";
  }
  return(
    <h1>{levelName}</h1>
  )
}

let levelname = level();

  if(isSolved){

  
  return(
    <div className="SolvedCardContainer">
         {difficultyLevel}
      <span>{("0" + Math.floor((props.scoreCard.time / 60000) % 60)).slice(-2)}:</span>
        <span>{("0" + Math.floor((props.scoreCard.time / 1000) % 60)).slice(-2)}</span>
         {levelname}
    </div>
  )
  }
  return <></>
}

export default SolvedScreen;
